            member.attends_school = True
            member.engaged_with_school = True
            changed = True
        elif member.attends_school is not None and member.engaged_with_school is not None:
            if (member.attends_school and member.engaged_with_school) is False:
                member.attends_school = False
                member.engaged_with_school = False
